import "./App.css";
import User from "./Components/User";
import UserProfile from "./Components/UserProfile";

function App() {
  return (
    <div className="App">
       <BrowserRouter>
      <Routes>
        <Route path="/" element={<User />}>
          <Route path="userProfile" element={<UserProfile />} />
        </Route>
      </Routes>
    </BrowserRouter>
      {/* <User />
      <UserProfile /> */}
    </div>
  );
}

export default App;
